import React, { useState } from 'react';
import { Route, Routes } from 'react-router-dom';
import HomePage from './pages/HomePage';
import LoginPage from './pages/LoginPage';
import RegisterPage from './pages/RegisterPage';
import ForgotPasswordPage from './pages/ForgotPasswordPage';
import AdminPage from './pages/AdminPage';
import UserDashboardPage from './pages/UserDashboardPage';
import QuizPage from './pages/QuizPage';
import NotFoundPage from './pages/NotFoundPage';
import PrivateRoute from './components/Common/PrivateRoute';
import EditQuiz from './components/Admin/EditQuiz';
import UserManagement from './components/Admin/UserManagement'; // Import User Management Page
import QuizManagement from './components/AdminQuizManagement'; // Import Quiz Management Page
import Analytics from './components/Admin/Analytics'; // Import Analytics Page
import ContactUsFormDetails from './components/Admin/ContactUsFormDetails'; // Import Contact Us Page

const AppRoutes = () => {
  const [quizzes, setQuizzes] = useState([]);

  return (
    <Routes>
      <Route path="/" element={<HomePage />} />
      <Route path="/login" element={<LoginPage />} />
      <Route path="/register" element={<RegisterPage />} />
      <Route path="/forgot-password" element={<ForgotPasswordPage />} />
      <Route path="/admin" element={<PrivateRoute component={AdminPage} />} />
      <Route path="/user-management" element={<PrivateRoute component={UserManagement} />} />
      <Route path="/quiz-management" element={<PrivateRoute component={QuizManagement} />} />
      <Route path="/analytics" element={<PrivateRoute component={Analytics} />} />
      <Route path="/contact-us" element={<PrivateRoute component={ContactUsFormDetails} />} />
      <Route path="/quiz/:id" element={<PrivateRoute component={QuizPage} />} />
      <Route path="/edit-quiz/:id" element={<EditQuiz quizzes={quizzes} setQuizzes={setQuizzes} />} />
      <Route path="*" element={<NotFoundPage />} />
    </Routes>
  );
};

export default AppRoutes;
